import React from 'react';
import Navbar from './components/Navbar';
import Footer from './components/Footer';  // Importe o Footer
import './index.css';
import pousadaImage from './assets/pousada.jpg';

function App() {
  return (
    <div className="App">
      <Navbar />
      <main>
        <h2>Bem-vindo à Pousada Pinheira</h2>
        <p>Localizada na bela Praia de Cima, oferecemos conforto e tranquilidade para suas férias.</p>

        <img src={pousadaImage} alt="Pousada Pinheira" style={{ width: '100%', maxWidth: '800px', height: 'auto', borderRadius: '8px' }} />

        <p>Saiba mais sobre nós.</p>
      </main>
      <Footer />  {/* Adicione o Footer */}
    </div>
  );
}

export default App;
